commonAbstractCriteriaMustBeRoot                                = “{0}”必须给率先压入
specialObjectMustNotBeRoot                                      = “{0}”必须作为根节点，不能被率先压入
specialObjectMustBePushedAfterXAbstractQuery                    = “{0}”必须在“{1}”之后压入
nodeThatIsNotSelectionOrOrderMustNotBeRootOrUnderXAbstractQuery = “{0}”和“{1}”不能作为根节点，也不能在“{2}”之后被压入
canNotPopOnEmptyAllocator                                       = 当前“{0}”长度为0，不能进行弹出操作
canNotAllocatePathIdBecauseNoNodeOrNodeIsNotPath                = 不能分配路径id，因为当前节点不存在或不为“{0}”
secondaryPathIdOutOfPriamryIds                                  = 不能分配次路径id，因为没有相关的主路径id
secondaryPathIdNotEqualsPrimaryPathId                           = 次路径id和主路径id不等
